def secondLargestElement(arr):

    first = max(arr[0], arr[1])
    second = min(arr[0], arr[1])

    for i in range(2, len(arr)):
        
        if arr[i] > first:
            second = first
            first = arr[i]

        elif arr[i] > second and arr[i] < first:
            second = arr[i]

    return second

