def isSorted(arr):

    rotated = []
    for i in range(len(arr)-1):
        if arr[i+1] < arr[i]:
            rotated += arr[i+1:] + arr[:i+1]
            break

    print(rotated)

    if rotated:
        print("rotated")
        for i in range(len(rotated)-1):
            if rotated[i+1] < rotated[i]:
                return False
    return True

