def rotateArr(arr):

    lastelement = arr[-1]

    for i in range(len(arr)-2, -1, -1):
        arr[i+1] = arr[i]
    
    arr[0] = lastelement
    return arr

def rotate(arr,k):

    for i in range(k):
        arr = rotateArr(arr)
    return arr

