def rotate(arr, k):

    k %= len(arr)
    count = k
    queue = []

    if k:
        for i in range(len(arr)-1, -1, -1):
            if k:
                queue.append(arr[i])
                k-= 1
            else:
                arr[i+count] = arr[i]

    if queue:
        for i in range(len(queue)-1, -1, -1):
            arr[i] = queue.pop(0)

    return arr

