def seperate(arr):

    left = 0
    right = len(arr)-1

    while left < right:

        if arr[left] == 0:
            left += 1
        if arr[right] == 1:
            right -= 1

        if arr[left] != 0 and arr[right] != 1:
            arr[left], arr[right] = arr[right], arr[left]
            left +=1 
            right -= 1

    return arr

def seperate(arr):

    count = 0
    pointer = 0

    while pointer < len(arr):

        if arr[pointer] == 0:
            arr.pop(pointer)
            count += 1
            continue
        pointer += 1

    return arr + [0] * count
    


