def lengthOfLongestString(arr, k):

    left = 0
    right = 0
    sum = 0
    maximum = 0

    while right < len(arr):

        sum += arr[right]
        
        if sum == k:
            maximum = max(maximum, right-left+1)
            left += 1
            right += 1
        elif sum < k:
            right += 1
        else:
            sum -= arr[left]
            left += 1
        print(sum, left, right)
    return maximum

